document.addEventListener("DOMContentLoaded",function(){const t=document.querySelectorAll("img:not([loading])");function e(t){return t.getBoundingClientRect().top<window.innerHeight}t.forEach(function(t){t.hasAttribute("loading")||(e(t)?(t.setAttribute("loading","eager"),t.setAttribute("fetchpriority","high")):(t.setAttribute("loading","lazy"),t.setAttribute("fetchpriority","low")))}),t.forEach(function(t){t.hasAttribute("decoding")||t.setAttribute("decoding","async")})});
